import React, { useState } from "react";
import { useNavigate } from 'react-router-dom';
import Login from "./Login";
import Register from "./Register";
import "./AuthForm.css";

const AuthForm = () => {
  const [signInMode, setSignInMode] = useState(true);

  const toggleMode = () => {
    setSignInMode(!signInMode);
  };

  return (
    <div className={`container ${!signInMode ? "sign-up-mode" : ""}`}>
      <div className="forms-container">
        <div className="signin-signup">
          <Login />
          <Register />
        </div>
      </div>

      <div className="panels-container">
        <div className="panel left-panel">
          <div className="content">
            <h3>New here?</h3>
            <p>Sign up to explore our event photo management system!</p>
            <button className="btn transparent" onClick={toggleMode}>
              Sign Up
            </button>
          </div>
          <img src="path-to-your-image" className="image" alt="Sign Up" />
        </div>
        <div className="panel right-panel">
          <div className="content">
            <h3>One of us?</h3>
            <p>Sign in to continue accessing your event photos!</p>
            <button className="btn transparent" onClick={toggleMode}>
              Sign In
            </button>
          </div>
          <img src="path-to-your-image" className="image" alt="Sign In" />
        </div>
      </div>
    </div>
  );
};

export default AuthForm;
